import React from 'react';

import Navbar from './Navbar';
import '../assets/css/App.css';

class App extends React.Component {
  state = {
    isLoggedin:false
  }

  render() {
    return (
      <div className="App">
        <Navbar isLoggedin ={this.state.isLoggedin}/>

      </div>
    );
  }
}

export default App;
